import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_view.png'));

    // Open mobile menu by clicking the nav-menu button
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to appear and take screenshot
    await page.waitForSelector('.mobile-menu-overlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_open.png'));

    // Click on a menu item (Electronics)
    await page.waitForSelector('.mobile-menu-content a', { timeout: 5000 });
    const menuItems = await page.$$('.mobile-menu-content a');
    await menuItems[0].click();

    // Wait for navigation and take screenshot
    await page.waitForTimeout(1000); // Brief pause for navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_navigation.png'));

    // Close mobile menu
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');

    // Verify menu is closed
    await page.waitForSelector('.mobile-menu-overlay:not(.show)', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_menu_closed.png'));

    return {
      success: true,
      action: "Successfully tested mobile menu navigation - opened menu, navigated to Electronics category, and closed menu",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
